import './summary.css';

export default function Summary({ tasksNumber, completedTaskNumber }) {
    console.log(tasksNumber, completedTaskNumber)
    return (
        <footer>
            <div>
                <p>
                    you have <span>{tasksNumber}</span> tasks on your todo list
                    and you have already completed{' '}
                    <span>{completedTaskNumber}</span>.{' '}
                    <span>({`${completedTaskNumber / tasksNumber}%`})</span>
                </p>
            </div>
        </footer>
    );
}
